legend()
grid("on")
title("Panel Method Drag Coefficient")
xlabel("Number of Panels")
ylabel("Drag Coefficient")

# CM convergence
figure()
semilogx(numPanels,CM_integration,   label = "Surface Integration",    marker = "o",color = "red",linestyle = "--")
